import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import styles from './StockDetails.module.css';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer } from 'recharts';
import axios from 'axios';

const dummyStocks = {
  AAPL: { id: 1, name: 'Apple Inc.', price: 172.25, change: 1.32 },
  TSLA: { id: 2, name: 'Tesla Inc.', price: 254.75, change: -2.12 },
  AMZN: { id: 3, name: 'Amazon.com', price: 140.89, change: 0.87 },
  MSFT: { id: 4, name: 'Microsoft', price: 310.21, change: -0.55 },
  NVDA: { id: 5, name: 'NVIDIA', price: 450.10, change: 2.95 },
};

// Example mock chart data (you can replace with backend data later)
const dummyHistory = [
  { date: '2024-04-01', price: 160.5 },
  { date: '2024-04-02', price: 165.0 },
  { date: '2024-04-03', price: 170.2 },
  { date: '2024-04-04', price: 172.25 },
];

const StockDetails = () => {
  const { symbol } = useParams();
  const navigate = useNavigate();
  const [message, setMessage] = useState('');
  const [history, setHistory] = useState([]);
  const stock = dummyStocks[symbol.toUpperCase()];

  const handleAddToWatchlist = async () => {
    try {
      const res = await axios.post('/watchlist', { stock_id: stock.id });
      setMessage('⭐ Added to watchlist!');
    } catch (err) {
      console.error(err);
      setMessage('❌ Failed to add to watchlist.');
    }
  };

  useEffect(() => {
    // Replace with actual API call when ready
    setHistory(dummyHistory);
  }, [symbol]);

  if (!stock) {
    return (
      <div className={styles.errorContainer}>
        <h2>Stock Not Found</h2>
        <button onClick={() => navigate('/')}>Back to Home</button>
      </div>
    );
  }

  return (
    <div className={styles.container}>
      <button className={styles.backBtn} onClick={() => navigate('/')}>← Back</button>

      <h1 className={styles.heading}>
        {stock.name} <span>({symbol.toUpperCase()})</span>
      </h1>

      <div className={styles.details}>
        <p className={styles.price}>Current Price: <strong>${stock.price.toFixed(2)}</strong></p>
        <p className={stock.change >= 0 ? styles.positive : styles.negative}>
          {stock.change >= 0 ? '+' : ''}{stock.change}% Today
        </p>
      </div>

      <button className={styles.watchlistBtn} onClick={handleAddToWatchlist}>⭐ Add to Watchlist</button>
      {message && <p className={styles.message}>{message}</p>}

      <div className={styles.chart}>
        <h3>📈 Price History</h3>
        <ResponsiveContainer width="100%" height={300}>
          <LineChart data={history}>
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="date" />
            <YAxis domain={['auto', 'auto']} />
            <Tooltip />
            <Line type="monotone" dataKey="price" stroke="#007bff" strokeWidth={2} />
          </LineChart>
        </ResponsiveContainer>
      </div>
    </div>
  );
};

export default StockDetails;
